id: favicon-new

info:
  author: anonymous
  name: Debug template computing the md5 hash of unknown favicons
  severity: info
  tags: generic,favicon,tech,noisy

http:
  - pre-condition:
      - type: dsl
        dsl:
          - 'method != "HEAD"'
          - 'method != "OPTIONS"'
        condition: and

    fuzzing:
      - part: header
        type: postfix
        mode: single
        fuzz:
          - ""

    matchers-condition: and
    matchers:
      - dsl:
            - 'status_code == 200'
            - 'contains(tolower(all_headers), "content-type: image/")'
            - 'contains(path, "ico")'
        type: dsl
        condition: and

